import './heroes.css';

function Heroes() {
    return (
        <div className="heroes-card">
            <img src="https://n1s1.hsmedia.ru/13/a5/b2/13a5b2373d5e23489d9a4949ada5b927/547x397_0xac120002_8752067681540468870.jpg" />
            <div className="hero-name">Бетмен</div>
            <div className="hero-universe">DC Comics</div>
            <div className="alterego">Брюс Уэйн</div>
            <div className="occupation">борец с преступностью, филантроп, миллиардер</div>
            <div className="friends">Робин, Бэтгерл</div>
            <div className="superpowers"></div>
            <div className="info"></div>
        </div>
    );
}

export default Heroes;
